import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Home = () => {
  const sliderImages = [
    "/img1.jpg",
    "/img2.jpg",
    "/img3.jpg",
  ];

  const sliderSettings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <div id="home" style={{ margin: "20px" }}>
      <Slider {...sliderSettings} style={{ display: 'block',  // Ensures the slider behaves like a block element
    margin: '0 auto', height: '20px',width:'1000px' }}>
        {sliderImages.map((image, index) => (
          <div key={index} style={{ height: '30px' }}>
            <img
              src={image}
              alt={`Slide ${index + 1}`}
              style={{ width: "100%", borderRadius: "10px" }}
            />
          </div>
        ))}
      </Slider>
    </div>
  );
};

export default Home;
